import React, { Component } from 'react'
import styles from './Search.module.css';
import { Button, Container, Row, Form, Col, InputGroup, FormControl } from 'react-bootstrap';
import search from './search.png';

export default class Search extends Component {
  render() {
    return (
        <div className={styles.form}>
      <Form action="/search/" method="get">
        <InputGroup>
          <Col md={1} xs={2}>
            <InputGroup.Prepend>
              <InputGroup.Text>
                <img src={search} width="40%" alt="Icon" loading="lazy" />
              </InputGroup.Text>
            </InputGroup.Prepend>
          </Col>
          <Col md={11} xs={10}>
            <FormControl type="text" className={styles.search_form} placeholder="ФИО ученика" aria-label="Поиск" />
          </Col>
        </InputGroup>
      </Form>
    </div>
    )
  }
}
